import React from "react";

export default function WeatherForecast() {
  return (
    <div className="WeatherForecast">
      <div className="row">
        <div className="col">
          <div className="WeatherForecast-day">Day 1</div>
          <WeatherIcon code="02d" size={36} />
        </div>
      </div>
    </div>
  );
}
